column11:
The war has ended, leaving deaths and sorrows;
He crawls on the ground, escaping from being captured;
Dreaded and painful, freedom is the only hope he has;
"No, No, No," the captor says, there's nothing left to you.

Greeted by hatred and distrust, man is tired;
Cheated by friends and love, he has no words;
Meeting by the stars, that's the original plan;
"How about goodbye instead?" A cloud in trousers says.

Freedom is not free, that what the war taught him;
Dreaded and painful, old memories just be brought back;
"Leave me alone", that's what he said ;
"Nothing can tear us apart", she smiles yet he screams.

Trapped in the hallow, with no sense of time;
Kept in the darkness, with memories fading away;
Wept the man, "where am I?"
Clapped by the spirit, "welcome to void."

King is tired, of looking at all the deaths he ordered;
Queen is inspired, by committing all the conspiracies she loved;
Between the glory and shame, the Monarchy is built by blood;
Beneath the throne, buried the unknown owners of former crown.

Back home from battlefield, man is dreaded and tired;
Greeted by debris and sorrow, he found home in ashes;
Treated all injuries and wounds, now just what he thought;
Wounds are now opened, fresh and painful.

Tired of traffic, noise and parking;
Dreaded pollution, rent and crimes;
Moving to the country seems to be the silver bullet;
Panacea only brings loneliness instead.
